    false,nt"url": null,nt"notes": "This data set includes 7 georeferenced
    and clipped versions of aerial photographs from August 1960, taken over Monte Vista
    National Wildlife Refuge. A georeferenced mosaic of the photographs is included
    in the data set.  Like other historic photos, this image allows for interpretation
    of habitat types on the refuge in 1960. Change over time estimates can be made from
    this image using current imagery for comparison. This image, along with others,
    are being used by refuge staff to assist in understanding and visualizing the historical
    content of the lands within the refuge and how they have changed.  The original
    black and white aerial photograph was acquired in digital form from USGS EarthExplorer.
    Individual frames were referenced to the 2009 NAIP color imagery with ArcMap 10.0.
    The resolution of the image is 3 meters. This image should be used for resource-level
    interpretation only.",nt"license_title": "License Not Specified",nt"extras":
